declare namespace org {
    namespace apache {
        namespace tomcat {
            namespace util {
                namespace modeler {
                    /**
                     * <p>Internal configuration information for a <code>Parameter</code>
                     * descriptor.</p>
                     * @author Craig R. McClanahan
                     */
                    // @ts-ignore
                    class ParameterInfo extends org.apache.tomcat.util.modeler.FeatureInfo {
                        /**
                         * Standard zero-arguments constructor.
                         */
                        // @ts-ignore
                        constructor()
                        /**
                         * Create and return a <code>MBeanParameterInfo</code> object that
                         * corresponds to the parameter described by this instance.
                         * @return a parameter info
                         */
                        // @ts-ignore
                        public createParameterInfo(): javax.management.MBeanParameterInfo
                    }
                }
            }
        }
    }
}
